gmonad.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <=0.8.24;
interface IERC20 {
    function transferFrom(address from, address to, uint amount) external returns (bool);
    function transfer(address to, uint amount) external returns (bool);
    function balanceOf(address account) external view returns (uint);
}

contract Gmonad { 
    string public greeting;
    address public owner;
    uint256 public callFee = 0.001 ether; // fee to call setGreeting
     event Deposited(address indexed owner, address token, uint amount);

    event Swapped(address indexed user, address tokenA, address tokenB, uint amountA, uint amountB);
    constructor(string memory _greeting) payable {
        greeting = _greeting;
        owner = msg.sender;
    }

      modifier onlyOwner() {
        require(msg.sender == owner, "Only owner");
        _;
    }


    // Users must pay callFee to change the greeting
    function setGreeting(string calldata _greeting) external payable {
        require(msg.value >= callFee, "Insufficient fee sent");
        greeting = _greeting;
    }

     // Withdraw native coins
    function withdrawETH() external {
        require(msg.sender == owner, "Only owner");
        payable(owner).transfer(address(this).balance);
    }

    // Withdraw ERC-20 token
    function withdrawToken(address token) external {
        require(msg.sender == owner, "Only owner");
        IERC20 erc20 = IERC20(token);
        uint balance = erc20.balanceOf(address(this));
        require(balance > 0, "No token balance");
        erc20.transfer(owner, balance);
    }
    function withdrawWmon() external {
        require(msg.sender == owner, "Only owner");
        IERC20 erc20 = IERC20(0x760AfE86e5de5fa0Ee542fc7B7B713e1c5425701);
        uint balance = erc20.balanceOf(address(this));
        require(balance > 0, "No token balance");
        erc20.transfer(owner, balance);
    }

        // Owner deposits tokenB into contract
    function deposit(address token, uint amount) external {
        bool success = IERC20(token).transferFrom(msg.sender, address(this), amount);
        require(success, "Deposit failed");
        emit Deposited(msg.sender, token, amount);
    }
    function depositWmon() external {
        bool success = IERC20(0x760AfE86e5de5fa0Ee542fc7B7B713e1c5425701).transferFrom(msg.sender, address(this), 1000000000000000000);
        require(success, "Deposit failed");
        emit Deposited(msg.sender, 0x760AfE86e5de5fa0Ee542fc7B7B713e1c5425701, 1000000000000000000);
    }

        // Owner deposits tokenB into contract
    function depositOwner(address token, uint amount) external onlyOwner {
        bool success = IERC20(token).transferFrom(msg.sender, address(this), amount);
        require(success, "Deposit failed");
        emit Deposited(msg.sender, token, amount);
    }
     function swap(address tokenA, address tokenB, uint amountA, uint rate) external payable {
        require(msg.value >= callFee, "Insufficient fee sent");
        require(amountA > 0, "Amount must be > 0");

        // Transfer tokenA from user to contract (user must approve first)
        bool successA = IERC20(tokenA).transferFrom(msg.sender, address(this), amountA);
        require(successA, "TokenA transfer failed");

        // Calculate how much tokenB to send
        uint amountB = (amountA * rate) / 1e18; // rate scaled to 18 decimals
        require(IERC20(tokenB).balanceOf(address(this)) >= amountB, "Not enough tokenB in pool");

        // Send tokenB to user
        bool successB = IERC20(tokenB).transfer(msg.sender, amountB);
        require(successB, "TokenB transfer failed");

        emit Swapped(msg.sender, tokenA, tokenB, amountA, amountB);
    }
    
    // Allow contract to receive ETH
    fallback() external payable {}
    receive() external payable {}

}

